import React from "react";

const Person = (props) => {
  const content =
    props.persons &&
    props.persons?.map((person, index) => (
      <div key={index}>
        <p key={person.name}>
          {person.name} {person.number}
        </p>
        <button onclick={()=>props.deletePerson(person.id)}>Delete</button>
      </div>
    ));
  return <div>{content}</div>;
};

export default Person;
